import App from "@/App.vue";
import AuthUser from "@/components/authUser.vue";
import {createRouter} from 'vue-router';

export default new createRouter({
  mode: "history",
  routes: [
    {
      path: "/",
      name: "home",
      component: App,
    },
    {
      path: "/auth",
      name: "authUser",
      component: AuthUser,
    },
  ],
});
